    "A High Performance Cathode Heater for Hall Thrusters Project",nt"tracking_summary":
    {ntt"total": 10,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T21:37:11.204400",nt"name": "a-high-performance-cathode-heater-for-hall-thrusters-project",nt"isopen":
    true,nt"url": null,nt"notes": "High current hollow cathodes are the baseline
    electron source for next generation high power Hall thrusters.  Currently for electron
    sources providing current levels &gt;50 A and cathodes utilizing LaB6 emitters,
    the only viable, long life heater technology is a low reliability, low producibility,
    multi-element heater constructed from MgO insulated coaxial heater cable.  In the
    Phase I project we will develop novel insulator materials to replace MgO that can
    provide high temperature capability, with good thermal conductivity and electrical
    isolation.  We will design, fabricate, and test prototype swaged coaxial heaters
    incorporating the novel insulators, in collaboration with a heater manufacturer
    and an end user aerospace company.",nt"license_title": "U.S. Government Work",nt"extras":
